import React from 'react';

const Shop: React.FC = () => {
    return (
        <div className="shop-page" style={{ padding: '2rem' }}>
            <h1>Shop</h1>
            <p>Browse our latest footwear collection!</p>
            {/* Product listing will go here */}
            <div className="products-grid">
                {/* Example placeholder products */}
                <div className="product-card">
                    <img src="/placeholder-shoe.jpg" alt="Shoe" style={{ width: '100%' }} />
                    <h2>Classic Sneaker</h2>
                    <p>$79.99</p>
                    <button>Add to Cart</button>
                </div>
                <div className="product-card">
                    <img src="/placeholder-shoe2.jpg" alt="Shoe" style={{ width: '100%' }} />
                    <h2>Sport Runner</h2>
                    <p>$89.99</p>
                    <button>Add to Cart</button>
                </div>
            </div>
        </div>
    );
};

export default Shop;
